$zipwuvov = [System.Convert]::FromBase64String("ikf4rUI9UhBUXNc6juXscc5Y7OXzBQM50vIxE1gRR1w=")
$ufsvo.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
$ufsvo.KeySize = 192
$ufsvo.Key = $zipwuvov
$ufsvo.Mode = [System.Security.Cryptography.CipherMode]::CBC
$ufsvo.IV = $zyoanx[0..15]
$ufsvo.BlockSize = 128
